CREATE FUNCTION auditoria.registrar_cambio() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF TG_OP = 'DELETE' THEN
            tabla, operacion, registro_id, datos_anteriores, 
            usuario, fecha_cambio
        ) VALUES (
            TG_TABLE_NAME, TG_OP, OLD.id, row_to_json(OLD), 
            current_user, CURRENT_TIMESTAMP
        );
        RETURN OLD;
    ELSIF TG_OP = 'UPDATE' THEN
            tabla, operacion, registro_id, datos_anteriores, datos_nuevos,
            usuario, fecha_cambio
        ) VALUES (
            TG_TABLE_NAME, TG_OP, NEW.id, row_to_json(OLD), row_to_json(NEW),
            current_user, CURRENT_TIMESTAMP
        );
        RETURN NEW;
    ELSIF TG_OP = 'INSERT' THEN
            tabla, operacion, registro_id, datos_nuevos,
            usuario, fecha_cambio
        ) VALUES (
            TG_TABLE_NAME, TG_OP, NEW.id, row_to_json(NEW),
            current_user, CURRENT_TIMESTAMP
        );
        RETURN NEW;
    END IF;
    RETURN NULL;
END;
$$;


